#include <vector>
#include <iostream>
using namespace std;

class Solution {

private:

long long factorial(long long n){
    long long result{0};
    for(int i=1; i <= n; ++i){
        result += i;
    }
    return result;
}
vector<int>::const_iterator isValid(const vector<int>& sub_nums){
    for(auto it = sub_nums.begin(); it != sub_nums.end(); ++it){
        if(it != sub_nums.cend()-1){
            if(*it == *(it+1)){
                return it;
            }
        }
    }
    return sub_nums.end();
}

long long caculate(const vector<int>& nums){
    long long result = 0;
    auto it = isValid(nums);
    if(it == nums.end()){
        return factorial(nums.size());
    }
    result += caculate(vector<int>(nums.begin(), it+1));
    result += caculate(vector<int>(it+1, nums.end()));
    return result;
}
public:
    long long countAlternatingSubarrays(vector<int>& nums) {
        return caculate(nums);
    }
};

